import ReactDOM from 'react-dom/client';

const root = ReactDOM.createRoot(document.getElementById('root'));

const Home = () => {
    return (<>
        <h1>Home Page</h1>
    </>)
}

const About = () => {
    return (<>
        <h1>About Page</h1>
    </>)
}

const Contact = () => {
    return (<>
        <h1>Contact Page</h1>
    </>)
}


const Login = () => {
    return (<>
        <h1>Login Page</h1>
    </>)
}
